import { useHistory } from "react-router-dom";

import NavBar from "./NavBar"

const ContactPage = ({ match  }) => {
const buttStyle = "bg-red-400 px-4 py-4 text-white text-center mt-4 w-full"
    return ( 
        <>
        <NavBar></NavBar>

    <div className="w-full flex">
        <div className="mx-auto w-1/3 mt-24 text-4xl text-center font-semibold">
            <p>Interested in Getting In Touch With Us? Click the below!</p>
            <div className="w-2/3 flex flex-col mx-auto text-center">
                <button className={buttStyle}>Recruiting</button>
                <button className={buttStyle}>Sponsorship</button>
                <button className={buttStyle}>Other Contacts</button>
            </div>
        </div>
    </div> 
    </>
    )

};

export default ContactPage;
